import './App.css';


function App() {

  const inputStyle = {
    outline: "none",
    borderTop: "none",
    borderRight: "none",
    borderLeft: "none",
    borderBottomColor: 'gray',
    borderBottomWidth: 2.5,
    fontSize: "25px",
    marginTop: "2rem"
  }

  const h1Style = {
    color: "yellow"
  }

  return (
    <div className="App">
      <h1 style={h1Style}>Partha's todo app</h1>
      <input style={inputStyle} placeHolder="add todo" />
    </div>
  );
}

export default App;
